namespace GetIt

open System

type Pen =
    { IsOn: bool
      Weight: float
      Color: RGBA }

module Pen =
    [<CompiledName("Default")>]
    let ``default`` = { IsOn = false; Weight = 1.; Color = RGBAColor.black }

type PenLine =
    { Start: Position
      End: Position
      Weight: float
      Color: RGBA }

type PlayerId = PlayerId of Guid

type Player =
    { SizeFactor: float
      Position: Position
      Direction: Degrees
      Pen: Pen
      SpeechBubble: SpeechBubble option
      Costumes: Costume list
      CostumeIndex: int }
    member this.Costume with get() = this.Costumes |> List.item this.CostumeIndex

    member this.Size with get() = this.Costume.Size * this.SizeFactor

    member this.Bounds
        with get() =
            { Position =
                { X = this.Position.X - this.Size.Width / 2.
                  Y = this.Position.Y - this.Size.Height / 2. }
              Size = this.Size }

